INSERT INTO `pages` VALUES (1,'O que o pintor NÃO deve fazer','<h4><strong>O QUE O PINTOR NÃO DEVE FAZER</strong></h4>\r\n<p>\r\n	<span style=\"color: #a5a5a5;\"><em>Dicas de pintura</em></span>\r\n</p>\r\n<p>\r\n	<img src=\"http://icons.iconarchive.com/icons/visualpharm/must-have/256/Cancel-icon.png\" alt=\"\" style=\"width: 150px; height: 150px; float: left; margin: 0px 10px 10px 0px; padding-right: 30px; padding-bottom: 15px\">\r\n</p>\r\n<ol>\r\n	<li>Iniciar a pintura sem antes fazer um teste comparativo de cor;</li>\r\n	<li>Utilizar Thinner ou Catalisadores não recomendados pela fábrica;</li>\r\n	<li>Aplicar Massa Rápida sobre a chapa nua;</li>\r\n	<li>Aplicar tinta sem antes fazer uma boa limpeza na superfície;</li>\r\n	<li>Misturar produtos de marcas diferentes;</li>\r\n</ol>\r\n<hr>\r\n<p>\r\n	<span style=\"color: #a5a5a5;\"><em>Estamos a disposição para quaisquer dúvidas, sinta-se a vontade parar entrar em contato com nossos atendentes.</em></span>\r\n</p>','o-que-o-pintor-nao-deve-fazer','2014-01-21 17:24:15','2014-01-22 16:06:53',0),(2,'Noção sobre cores','<h4><strong>BREVE NOÇÃO SOBRE CORES</strong></h4>\r\n<p>\r\n	 <span style=\"color: #a5a5a5;\"><em>Curiosidades</em></span>\r\n</p>\r\n<p>\r\n	<img src=\"http://www.sanduichedealgodao.com.br/wp-content/uploads/2011/04/rodadecores.jpg\" alt=\"\" style=\"width: 150px; height: 150px; float: right; padding-left: 20px; padding-bottom: 20px;\">\r\n</p>\r\n<h4>Definição</h4>\r\n<p>\r\n	    Cor é a interpretação que nosso cérebro dá à luz que chega até nossos olhos. É uma resposta psicológica e ao mesmo tempo fisiológica a um estímulo físico. É o efeito das ondas de luz refletidas ou passadas através dos objetos. A cor sofre influência de: textura, brilho, homogeneidade, adaptação cromática e feito do fundo. As três variáveis usadas para definir uma cor são: tonalidade, luminosidade e saturação.\r\n</p>\r\n<hr>\r\n<p>\r\n	 <img src=\"https://encrypted-tbn1.gstatic.com/images?q=tbn:ANd9GcRtvxa-JpRrboz-diCBH4up3oD1ApEDoxhE4QeOrugBb2bTJEBQ\" alt=\"\" style=\"float: right; padding-left: 20px; padding-bottom: 20px;\">\r\n</p>\r\n<h4>Formação</h4>\r\n<p>\r\n	    As cores são obtidas pela combinação de três cores primárias: amarelo, azul e vermelho. Misturando-se as cores primárias duas a duas, obteremos as cores secundárias: laranja, verde e violeta. Para que a cor exista é necessário: luz, objeto e observador. Só podemos ver cores nos objetos que emitam luz ou que sejam iluminados.\r\n</p>\r\n<hr>\r\n<p>\r\n	<span style=\"color: #a5a5a5;\"><em>Estamos a disposição para quaisquer dúvidas, sinta-se a vontade parar entrar em contato com nossos atendentes.</em></span>\r\n</p>','nocao-sobre-cores','2014-01-21 17:45:17','2014-01-21 19:04:07',0),(3,'Institucional','<h4><strong>LOJA DO PINTOR - INSTITUCIONAL</strong></h4>\r\n<p>\r\n	 <span style=\"color: #a5a5a5;\"><em>Conheça um pouco de nós</em></span>\r\n</p>\r\n<p style=\"width: 230px;\">\r\n	<a href=\"https://fbcdn-sphotos-a-a.akamaihd.net/hphotos-ak-ash3/t1/1381163_340501336095696_1059573163_n.jpg\" class=\"fancybox\"><img src=\"https://fbcdn-sphotos-a-a.akamaihd.net/hphotos-ak-ash3/t1/1381163_340501336095696_1059573163_n.jpg\" alt=\"\" style=\"width: 200px; height: 150px; float: left; margin: 0px 10px 10px 0px; padding-right: 30px; padding-bottom: 15px\"> </a>\r\n<a href=\"https://fbcdn-sphotos-d-a.akamaihd.net/hphotos-ak-frc3/t1/528805_111133615699137_1335026836_n.jpg\" class=\"fancybox\"><img src=\"https://fbcdn-sphotos-d-a.akamaihd.net/hphotos-ak-frc3/t1/528805_111133615699137_1335026836_n.jpg\" alt=\"\" style=\"width: 200px; height: 150px; float: left; margin: 0px 10px 10px 0px; padding-right: 30px; padding-bottom: 15px\"> </a>\r\n</p>\r\n<p>\r\n	             A Loja do Pintor é uma empresa que está no mercado desde meados de 1990 e vem sempre buscando inovações no que se refere a tecnologias, oferecendo sempre diferenciais em produtos que variam desde tintas imobiliárias, automotivas e industrias até ferramentas em geral.\r\n</p>\r\n<p>\r\n	          Estável e madura, a empresa atende hoje, principalmente, a região sul e sudeste do Brasil, oferecendo a seu público uma gama de mais de 10 mil produtos e sendo a pioneira em sua área a oferecer orçamentos e venda online, sempre com foco no bom relacionamento ao cliente, que pode agora escolher a pintura de sua casa e afins do conforto de casa com direito a toda atenção de nossos vendedores, disponíveis para esclarecimento de dúvidas.\r\n</p>','institucional','2014-01-23 16:10:50','2014-01-29 19:24:05',2);
/*!40000 ALTER TABLE `pages` ENABLE KEYS */;
