INSERT INTO `products` VALUES (8,'Resicolor Esmaltelit',25.00,95,'2013-11-26 17:23:29','2013-11-28 17:22:09','1273173314esmaltelit.png','<h4><strong>    Esmalte Base Água Resicolor</strong></h4>\r\n<p>\r\n	    É um produto desenvolvido especialmente para garantir o bem estar de quem aplica respeitando o meio ambiente. É à base de água oferecendo baixo odor, secagem rápida, fácil aplicação, bom alastramento, boa aderência e grande facilidade na limpeza, além de ser um produto onde as cores não amarelam. Com excelente acabamento, elevada cobertura, ótimo rendimento e grande resistência ao intemperismo. Indicado para aplicação em superfícies de alvenaria, madeiras, metais ferrosos, galvanizados, alumínio em exteriores e interiores. Dispensa o uso de aguarrás.\r\n</p>\r\n<ul>\r\n	<li>Produto classificado conforme norma ABNT NBR 11.702 de 04/92 – Tipo 4.2.5.</li>\r\n</ul>'),(9,'Resicolor Esmalte Color',14.90,17,'2013-11-26 17:28:27','2013-11-28 17:22:18','1315572251esmaltecolor36e900ml.jpg','<p>\r\n	   Acabamento de alto Brilho, boa cobertura, excelente rendimento e grande resistência ao intemperismo. Indicado para aplicação em superfícies de madeira e metal em exteriores e interiores. Produto classificado conforme ABNT 11.702 Tipo 4.2.1.\r\n</p>'),(21,'Resicolor Fundo a Óleo',10.00,97,'2013-11-28 16:50:15','2013-11-28 16:54:45','1273687710fundo_a_oleo.png','<p>\r\n	  Fundo para tintas sintéticas em madeira. Indicado para aplicação em madeira em exteriores e interiores. Possui acabamento fosco. Produto classificado conforme ABNT 11.702 Tipo 4.1.12.\r\n</p>'),(22,'Resicolor Fundo Galvanizado',20.00,97,'2013-11-28 16:55:35','2013-11-28 16:55:35','1273687710fundo_a_oleo.png','<p>\r\n	Primer para aderência de qualquer acabamento galvanizado em exteriores e interiores. Possui acabamento fosco.\r\n</p>'),(23,'Resicolor Pinta Mais',29.90,20,'2013-11-28 19:11:44','2013-11-28 19:11:44','1319712111pintamais36e18l.jpg','<p>\r\n	Pinta Mais é uma tinta com alto rendimento, aspecto fosco aveludado, com excelente cobertura úmida, baixo odor, indicado para uso interno com baixo respingo proporcionando um ótimo acabamento. Produto sem cheiro, após 3 horas de aplicação, segundo pesquisa realizada em que 90% dos consumidores avaliaram a intensidade do cheiro como fraco/sem cheiro. Produto classificado conforme norma ABNT NBR 15079 Produto classificado conforme ABNT 11702 tipo 4.5.3\r\n</p>'),(24,'Resicolor Piso e Cimentados',39.90,28,'2013-11-28 19:15:58','2013-11-28 19:15:58','1330098612pisosecimentados18le36l.jpg',''),(25,'Resicolor Selador Acrílico Pigmentado',17.90,36,'2013-11-28 19:19:01','2013-11-28 19:19:51','1313771571complementos2ok.jpg','<p>\r\n	Selador Acrílico para preparação de superfícies em alvenaria externa e interna. Indicado para uniformização das superfícies de concreto e reboco. Produto classificado conforme ABNT 11.702 Tipo 4.1.2.5\r\n</p>'),(26,'Resicolor Super Cobertura Fosca',42.90,23,'2013-11-28 19:24:04','2013-11-29 11:41:06','1319712946supercobertura36e18l.jpg','<p>\r\n	 Super Cobertura é um produto que proporciona embelezamento exclusivo na sua pintura e ótima resistência as intempéries como sol e chuva e efeito Plus na resistência de lavabilidade. Especialmente aditivado com biocidas de última geração, proporciona proteção contra fungos e mofo. Disponível em acabamento fosco e semi brilho. Produto sem cheiro, após 3 horas de aplicação, segundo pesquisa realizada em que 90% dos consumidores avaliaram a intensidade o cheiro como fraco/sem cheiro. Produto classificado conforme norma ABNT NBR 15079. Produto Classificado conforme norma ABNT NBR 11.702 Tipo 4.5.2\r\n</p>'),(27,'Resicolor Tinta a Óleo',39.90,18,'2013-11-28 19:24:31','2013-11-28 19:27:18','1315572466tintaleo36e900ml.jpg','<p>\r\n	Acabamento brilhante com boa cobertura e resistência ao intemperismo. Indicado para aplicação em madeira e metal em exteriores e interiores. Produto classificado conforme ABNT 11.702 Tipo 4.2.2.\r\n</p>'),(28,'Ciacollor Linha Econômica',29.90,20,'2013-11-28 19:32:21','2013-12-18 17:05:53','economica_comp.jpg','<p>\r\n	  É uma tinta acrílica fosca a base de água de fácil aplicação que proporciona baixo nível de respingo e oferece bom acabamento. Indicado para pinturas de superfícies de alvenaria, gesso, reboco, fibrocimento e concreto sendo indicada apenas para áreas internas.\r\n</p>'),(29,'Ciacollor Premium Fosca',39.90,23,'2013-11-29 10:47:34','2013-12-18 17:05:15','premium_completo.jpg','<p>\r\n	  É uma tinta acrílica à base de água com alto poder ligante, de fácil aplicação que proporciona baixo nível de respingo e excelente acabamento. Indicado para pintura de superfícies em áreas internas e externas como: alvenaria, reboco, fibrocimento, concreto e gesso. Disponível no acabamento Fosco.\r\n</p>'),(30,'Ciacollor Selador Acrílico Pigmentado',49.90,36,'2013-11-29 10:51:44','2013-11-29 11:14:13','selador.gif','<p>\r\n	 Este produto é indicado para selar superfícies em reboco novo reduzindo a absorção em áreas internas e externas. Segue classificação da norma NBR 11702 tipo 4.1.2.5.\r\n</p>'),(31,'Sherwin Williams Metalatex Supera Fosca',63.00,23,'2013-11-29 10:58:24','2013-11-29 12:54:39','download__2_.jpg','<p>\r\n	  Metalatex Acrílico Supera Sem Cheiro é uma tinta acrílica Premium que, além da excelente cobertura, da alta resistência e durabilidade, secagem rápida e ótimo rendimento, reforça o compromisso e respeito da Sherwin-Williams com o meio ambiente.\r\n</p>\r\n<p>\r\n	  Desenvolvida com matérias primas de alta tecnologia, sua formulação permite que a pintura seja feita em áreas internas ocupadas, garantindo que o ambiente permaneça sem cheiro* em até 3 horas após aplicação.\r\n</p>'),(32,'Sherwin Williams Metalatex Supera Semi-Brilho',76.00,27,'2013-11-29 11:00:03','2013-11-29 12:54:59','download__2_.jpg','<p>\r\n	  Metalatex Acrílico Supera Sem Cheiro é uma tinta acrílica Premium que, além da excelente cobertura, da alta resistência e durabilidade, secagem rápida e ótimo rendimento, reforça o compromisso e respeito da Sherwin-Williams com o meio ambiente.\r\n</p>\r\n<p>\r\n	  Desenvolvida com matérias primas de alta tecnologia, sua formulação permite que a pintura seja feita em áreas internas ocupadas, garantindo que o ambiente permaneça sem cheiro* em até 3 horas após aplicação.\r\n</p>'),(33,'Graff Jet Spray Alta Temperatura',18.00,98,'2013-11-29 11:04:20','2013-11-29 11:05:00','1277323292site-alta_temperatura.png','<p>\r\n	 Tinta Spray indicada para superfícies metálicas expostas a temperaturas de até 600 oC . Uso externo e Interno. Atributos : Excelente rendimento , Ótima cobertura , Fácil de aplicar , Superresistência a altas temperaturas , Secagem extrarápida , Não agride a camada de Ozônio.\r\n</p>'),(34,'Graff Jet Spray ',11.00,98,'2013-11-29 11:10:15','2013-11-29 11:10:28','1277324318site-alqudica.png','<p>\r\n	 Tinta Spray acrílica base solvente , especialmente desenvolvida para aplicação em metais. Atributos da linha : Excelente rendimento , ótima cobertura , Fácil de aplicar , Super resistência , Secagem extra rápida e Não agride a camada de Ozônio. Embalagens com 360 mL / 270 g.\r\n</p>'),(35,'Graff Jet Spray Metálico',18.00,98,'2013-11-29 11:13:13','2013-11-29 11:13:13','1277322085site-acrlica_3.png','<p>\r\n	Tinta Spray acrílica base solvente , especialmente formulada com pigmentos metálicos. Atributos da linha : Excelente rendimento , ótima cobertura , Fácil de aplicar , Super resistência , Secagem extra rápida e Não agride a camada de Ozônio. Embalagens com 360 mL / 270 g.\r\n</p>'),(36,'Gol Raz',7.90,99,'2013-11-29 11:21:10','2013-12-09 17:13:46','produto2.jpg','<p>\r\n	  Usado como redutor de viscosidade de tintas a óleo e esmaltessintéticos em óleo, desengordurante e desengraxante.\r\n</p>'),(37,'Gol Thinner 7000 Retardador',19.90,99,'2013-11-29 11:22:13','2013-11-29 11:22:13','produto2.jpg','<p>\r\n	Usado para retardar a secagem de tintas a base de nitrocelulose em dias frios, úmidos ou muito quentes\r\n</p>'),(38,'Gol Solução