144,'Autoshine Cera Limpadora',8.00,56,'2013-12-06 10:31:18','2013-12-06 10:31:18','cera_limpadora_autoshine_200_gr_sao_paulo_sp_brasil__3CEB62_1.jpg','<p>\r\n	Cera Limpadora Autoshine<strong> </strong>possui sua fórmula moderna que permite a sua fácil aplicação, pois é pré-abrandada, proporcionando muito brilho com pouco esforço. É a única cera que não deixa manchas brancas.\r\n</p>'),(145,'Brilholac Cera Limpadora',8.00,56,'2013-12-06 10:34:18','2013-12-06 10:50:44','download__6_.jpg','<p>\r\n	 É uma cera de polimento a base de carnaúba e silicone, de fácil aplicação e remoção, sem manchar as partes pretas do veículo. Encera produzindo um brilho intenso e protege contra os raios UVA e UVB, umidade, salinidade e detergentes de lavagens. Pode ser aplicada em qualquer tipo de pintura automotiva.\r\n</p>'),(146,'Brill Cera Limpadora',8.00,56,'2013-12-06 10:37:59','2013-12-06 10:37:59','113885992SZ.jpg','<p>\r\n	Cerabrill tem uma fórmula exclusiva à base de cera de carnaúba e silicone que limpa, protege e dá brilho ao seu veículo podendo ser aplicada em qualquer tipo de pintura sem danificá-la. Indicada para todos os tipos de veículos e pinturas Cerabrill deixa uma película protetora resistente à ação do tempo e um brilho intenso e duradouro.\r\n</p>'),(147,'Cera Colorida',12.00,56,'2013-12-06 10:45:36','2013-12-09 15:57:36','images__5_.jpg','<p>\r\n	 A cera colorida foi desenvolvida para realçar a cor e o brilho da pintura do carro.\r\n</p>'),(148,'Grand Prix Cera Limpadora Tradicional',18.00,56,'2013-12-06 10:47:37','2013-12-06 10:47:37','0025d.JPG','<p>\r\n	Cera Grand Prix® Tradicional Proteção e Brilho tem exclusiva fórmula, que pode ser aplicada em qualquer tipo de pintura, inclusive de carros novos com menos de 5 anos, sem danificá-las. Cera Grand Prix® Tradicional Proteção e Brilho protege e dá brilho de forma imbatível, podendo ser usada sob o sol ou a sombra. Protege contra as ações nocivas do calor, dos raios solares, da chuva e da maresia, deixando um brilho intenso e duradouro, removendo também as manchas e as partículas estranhas à pintura. Ótimos resultados também em lanchas de fiberglass e trailers.\r\n</p>'),(149,'Grand Prix Cera Limpadora Queimada',18.00,56,'2013-12-06 10:48:56','2013-12-06 10:48:56','prod_10376.jpg','<p>\r\n	Cera Grand Prix® Pinturas Queimadas foi especialmente formulada para devolver o brilho e remover as manchas de pinturas queimadas e opacas em carros usados. Não usar sob o sol nem em carrocerias fiberglass. Em pinturas metalizadas ou perolizadas, use Grand Prix Tradicional ou Grand Prix Impermeabilizadora.\r\n</p>'),(150,'Aplicador Massa Plástica Amarelo',1.50,60,'2013-12-06 11:14:29','2013-12-06 11:14:29','04052012083601.jpg','<p>\r\n	Aplicador de massa plástica feito de plástico\r\n</p>'),(151,'Aplicador Massa Plástica Silicone',1.50,60,'2013-12-06 11:15:44','2013-12-06 11:15:44','be1cc8805a22e40efd39a3ae1fa2072e.jpg','<p>\r\n	Aplicador de silicone.\r\n</p>'),(152,'Vareta P/ Solda de Ferro',9.90,62,'2013-12-06 11:55:14','2013-12-06 11:55:14','download__7_.jpg',''),(153,'Vareta P/ Solda Metal',2.00,62,'2013-12-06 12:20:02','2013-12-06 12:20:02','images__6_.jpg',''),(154,'Cola Branca 500g',9.90,64,'2013-12-06 13:00:17','2013-12-06 13:00:17','cola-branca-extra-cascorez-500g-6-pecas-nota-fiscal_MLB-F-3662426594_012013-480-0.jpg','<p>\r\n	Trata-se de um adesivo vinílico disperso em água, de cor branca, odor característico e média viscosidade, que após seco apresenta uma película transparente, plastificada, de alta resistência ao descolamento.\r\n</p>'),(155,'Taco',12.50,66,'2013-12-06 13:05:10','2013-12-06 13:05:10','lixador_borraxa_p.gif',''),(156,'Escova de Aço Manual',3.00,76,'2013-12-09 15:37:31','2013-12-09 15:37:31','GRD_adic01_1221_escova_de_a_o_reta.png','<p>\r\n	Escova de aço com cabo de madeira para limpeza de superfícies com ferrugem, sujas, etc.\r\n</p>'),(157,'Escova Copo Torcida',30.00,76,'2013-12-09 15:55:22','2013-12-09 15:55:22','260_1_13360.jpg',''),(158,'Ford Lixadeira Orbita