oduto_24.jpg','<p>\r\n	Indicado para diluição de Primers e Lacas à base de nitrocelulose. Boa resistência ao branqueamento. Pode ser substituído pelo Thinner Ecoeficiente Standard.\r\n</p>'),(168,'Anjo Thinner Eco 2900',9.90,99,'2013-12-13 10:51:13','2013-12-13 10:51:13','produto_193.jpg','<p>\r\n	Pensando na preservação do meio ambiente, a Anjo lançou a linha Ecoeficiente que utiliza em sua formulação solventes provenientes de fontes renováveis que provocam baixo impacto ambiental e ao ser humano, devido a baixa reatividade dos vapores de solventes liberados. Os Thinners Ecoeficientes estão no mercado em três versões: Thinner ECO 2750, Thinner ECO 2900 e Thinner ECO 2750. Estão preparados para serem usados nas mais diversas variações de tintas do mercado, mas seu grande benefício é a redução do impacto ambiental em aproximadamente 50% a 80% em relação aos thinners comuns.\r\n</p>'),(169,'Anjo Thinner Eco 5000',16.00,99,'2013-12-13 10:52:11','2013-12-13 10:52:11','produto_193.jpg','<p>\r\n	Pensando na preservação do meio ambiente, a Anjo lançou a linha Ecoeficiente que utiliza em sua formulação solventes provenientes de fontes renováveis que provocam baixo impacto ambiental e ao ser humano, devido a baixa reatividade dos vapores de solventes liberados. Os Thinners Ecoeficientes estão no mercado em três versões: Thinner ECO 2750, Thinner ECO 2900 e Thinner ECO 5000. Estão preparados para serem usados nas mais diversas variações de tintas do mercado, mas seu grande benefício é a redução do impacto ambiental em aproximadamente 50% a 80% em relação aos thinners comuns.\r\n</p>'),(170,'Catalizador Para Massa Plástica',1.20,61,'2013-12-13 10:56:36','2013-12-13 10:56:36','download__14_.jpg',''),(171,'Catalizador Para Esmalte Sintético',7.00,61,'2013-12-13 10:59:10','2013-12-13 10:59:10','96250242_05df78b2ee8aebc5e2de48583e226d18_67363022.jpg',''),(172,'Wanda Verniz Bi-Componente 1100',19.90,42,'2013-12-13 11:08:34','2013-12-13 11:08:34','418.01100.jpg','<p>\r\n	Verniz poli